import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { CrossfilterContext, Dimension, Group } from 'react-crossfilter';
import { RowChart } from 'react-dc';
import { DataGrid, GridToolbar } from '@mui/x-data-grid';

const CrossFilterChart = () => {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetchData();
  }, []);

  const fetchData = async () => {
    try {
      const response = await axios.get('/api/data');
      setData(response.data);
    } catch (error) {
      console.log(error);
    }
  };

  const createChart = () => {
    return (
      <CrossfilterContext data={data}>
        <Dimension accessor={(d) => d.column1} id="dimension1" />
        <Group
          dimension="dimension1"
          reduce={(d) => d.column1}
          id="group1"
          groupAll
        />
        <RowChart dimension="dimension1" group="group1" width={400} height={300} />

        <Dimension accessor={(d) => d.column2} id="dimension2" />
        <Group
          dimension="dimension2"
          reduce={(d) => d.column2}
          id="group2"
          groupAll
        />
        <RowChart dimension="dimension2" group="group2" width={400} height={300} />

        <div style={{ height: 400, width: '100%' }}>
          <DataGrid
            rows={data}
            columns={Object.keys(data[0]).map((key) => ({
              field: key,
              headerName: key,
              flex: 1,
            }))}
            components={{
              Toolbar: GridToolbar,
            }}
            pageSize={5}
            rowsPerPageOptions={[5, 10, 20]}
            disableSelectionOnClick
          />
        </div>
      </CrossfilterContext>
    );
  };

  return <div>{data.length > 0 ? createChart() : null}</div>;
};

export default CrossFilterChart;
